import React from "react";
import { styled } from "@mui/material/styles";

import { Grid, Paper, Stack, Typography } from "@mui/material";

export default function Subscription() {
  const iconStyle = {
    width: "20px",
    marginBottom: "20px",
  };
  const cardStyle = {
    height: "200px",
    justifyContent: "center",
    alignItems: "center",
    padding: "30px",
  };
  const cardTitle = { color: "white" };
  return (
    <>
      <Typography sx={{ textAlign: "left", marginBlock: "20px" }} variant="h2">
        بسته‌ها
      </Typography>

      <Grid dir="rtl" container spacing={2}>
        <Grid item xs={4}>
          <Paper sx={[cardStyle, { backgroundColor: "#FF4D00B2" }]}>
            <img
              style={iconStyle}
              src={require("../assets/images/Vector9.png")}
            />
            <Typography sx={cardTitle} variant="h1">
              اشتراک سه ماهه
            </Typography>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper sx={[cardStyle, { backgroundColor: "#FF4D00CC" }]}>
            <img
              style={iconStyle}
              src={require("../assets/images/Vector9.png")}
            />
            <Typography sx={cardTitle} variant="h1">
              اشتراک شش ماهه
            </Typography>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Stack>
            <Paper sx={[cardStyle, { backgroundColor: "#FF4D00" }]}>
              <img
                style={iconStyle}
                src={require("../assets/images/Vector9.png")}
              />
              <Typography sx={cardTitle} variant="h1">
                اشتراک یک ساله
              </Typography>
            </Paper>
          </Stack>
        </Grid>
      </Grid>
    </>
  );
}
